import React from 'react';
import styles from './Page.module.css';

const Page = () => {
  return (
    <div className={styles.main}>
      <div>My Page</div>
      <div>Messages</div>
      <div>Notifications</div>
      <button>Likes</button>
      <button>Views</button>
    </div>
  );
};

export default Page;
